import React from 'react'
import { useLocation, useParams } from 'react-router-dom'

const About = () => {

  let {name}= useParams()
const location= useLocation();
  return (
    <>
    <div><h1>About us Page: {name}</h1></div>
    <p>This is the current page: {location.state}</p>
    </>
  )
}

export default About
